import React from 'react';
import "./Header.css"

function Header() {
    return (
        <div className="header">
            <div className="header__top">
                <img 
                className="header__img"
                src="data:image/jpeg;base64,"
                alt="header pic"
                />

            </div>
        </div>
    )
}

export default Header
